import React from 'react';
import Button from '@material-ui/core/Button';
import {acceptPull,rejectPull} from './../../../actions/repo.actions';
import PullDenyButton from './bannerPullDenyButton';
import PullAcceptButton from './bannerPullAcceptButton';

class PullTab extends React.Component{
  constructor(props){
    super(props);
    this.handleAuthor=this.handleAuthor.bind(this);
    this.handlePull=this.handlePull.bind(this);
  }
  handleAccept(){
    this.props.dispatch(acceptPull(this.props.id));
  }
  handleReject(){
    this.props.dispatch(rejectPull(this.props.id));
  }
  handleAuthor(username){
    this.props.history.push(`/source/${username}`);
  }
  handlePull(id){
    this.props.history.push(`${this.props.match.url}/pull/${id}`);
  }
  render(){
    return (<div className="MostRecentPullRequest" style={{ color:"black", backgroundColor:"#cce5ff", display:"flex", alignItems:"center", paddingLeft:"10px", paddingRight:"10px", justifyContent:"space-between" }}>
    <div className="MostRecentPullRequestInfo" style={{ display:"flex" }} >
      <h4 style={{cursor:"pointer", textDecoration:"underline"}} onClick={()=>this.handlePull(this.props.pull.sha)}> Most recent pull request ({this.props.pull.title}) </h4>
      <h4 className="by">by</h4>
      {this.props.pull!==undefined && this.props.pull!==false && <h4 style={{cursor:"pointer", textDecoration:"underline"}} onClick={()=>this.handleAuthor(this.props.pull.author.name)}>{this.props.pull.author.name}</h4>}
    </div>
    <div className="MostRecentPullRequestActions" style={{ display:"flex" }} >
      <div>
        <PullAcceptButton/>
      </div>
      <div>
        <PullDenyButton/>
      </div>
      <div>
        <Button onClick={()=>this.props.closeMe(this.props.id)}>X</Button>
      </div>
    </div>
  </div>)
  }
}
export default PullTab;
